import React, { Component } from 'react';
import ReactDOM from 'react-dom';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      splash: true
    };
  }

  componentDidMount() {
    setTimeout(() => this.setState({ splash: !this.state.splash }), 3000);
  }

  render() {
    return (
      <h1>HELLO THERE</h1>
    );
  }

}
